import React from 'react';
import s from "./Navbar.module.css";

const Navbar = () => {
    return (
        <nav className="nav">
            <div> Profile</div>
            <div><a>Massages</a></div>
            <div><a>News</a></div>
            <div><a>Music</a></div>
            <div><a>Settings</a></div>
        </nav>)
}
    export default Navbar;
